attributes.tree_definition:
{
   "tree": [{
      "type": "bucket",
      "label": "%{$record.name}",
      "open": [["name","eq","content"],"OR",["name","eq","modules"],"OR",["name","eq","unload"]],
      "condition": "",
      "async": true,
      "sort_by": "name",
      "no_children": ["type","eq","file"],
      "page": "",
      "children": [{ 
         "type": "related",
         "bucket_node": false,
         "child": "bundle_content.parent",
         "condition": "",
         "open": false,
         "async": true,
         "recurse": true,
	      "no_children": ["type","eq","file"],
	      "page": "",
         "children": []
      }]
   }],
   "tags": {
      "folder": {
         "bucket": "bundle_content",
         "condition": ["type","eq","folder"],
         "icon": "fontawesome:folder-o",
         "drag": true,
         "drop": ["folder","system"]
      },
      "unload": {
         "bucket": "bundle_content",
         "condition": [["path","begins","/bucket/unload/"], ["type","eq","file"]],
         "icon": "fontawesome:file-code-o"
      },
      "file": {
         "bucket": "bundle_content",
         "condition": ["type","eq","file"],
         "icon": "fontawesome:file-o",
         "drag": true,
         "drop": ["folder","system"]
      },
      "locked": {
         "bucket": "bundle_content",
         "condition": ["type","eq","locked"],
         "icon": "fontawesome:lock"
      },
      "system": {
         "bucket": "bundle_content",
         "condition": ["type","eq","system"],
         "icon": "fontawesome:folder"
      }
   }
}
